/**
 * 作者：Mr.wang
 * 时间：2022/4/11
 * 文件名：index
 * 项目名称：脚手架
 * WebStorm
 */
import React, {Component} from "react";
import headInput from "./index..module.css"
export default class HeadInput extends Component {
    componentDidMount() {
        this.addData = this.props.addShowData
    }

    render() {
        this.addData()
        return (
            <div>
                <input className={headInput.input}/>
            </div>
        );
    }
}
